import React from "react";

import cl from "./Main.module.scss";

import { ArticlesList } from "./ArticlesList/ArticlesList";

const Main: React.FC = () => {
  return (
    <div className={cl["main"]}>
      <ArticlesList />
    </div>
  );
};

export default Main;
